¡Aviso importante!
La Dirección Municipal de Protección Civil Los Cabos informa a la ciudadanía que se encuentra en zonas vulnerables de Cabo San Lucas, los refugios temporales más cercanos a sus domicilios: Escuela Primaria Lázaro Cárdenas del Río (colonia Las Palmas); 
Escuela Primaria, Fernando Cota Sandez y, la Escuela Primaria Héroes de 1847 (colonia Lomas del Sol). #CiudadanosHaciendoHistoria
